    false,nt"url": null,nt"notes": "This narrative report for Red Rock Lakes
    National Wildlife Refuge outlines Refuge accomplishments from February 1941 to January
    1942. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, big
    game animals, furbearers, and predators- is also covered. The Refuge development
    and maintenance section discusses physical developments and plantings. Resource
    management is outlined; topics include grazing and haying. The public relations
    section of the report describes recreational uses, Refuge visitors, hunting, and
    fishing. Items of interest and photographs are attached.",nt"license_title":
